import React, { Component } from 'react'

export default class UpdateCovid19Data extends Component {
    constructor(props) {
        super(props);
        //state in react
        this.state = {
            finalData: [],
        }
    }
    async componentDidMount() {
        let url = `https://api.data.gov.in/resource/463d908b-c03b-47d3-b5bb-33d584d27f65?api-key=579b464db66ec23bdd000001cdd3946e44ce4aad7209ff7b23ac571b&format=json`;

        let data = await fetch(url);
        let parsedData = await data.json()
        console.log("data", parsedData.records);
        this.setState({
            finalData: parsedData.records
        })
    }
    render() {
        return (
            <div>


                {this.state.finalData.map((element, index) => {
                    return <div key={index} className=" col-sm-12 col-md-6 col-lg-4">

                        <div className="card" style={{ width: "18rem" }}>
                            {/* <img src="..." className="card-img-top" alt="..."> */}
                            <div className="card-body">
                                <h5 className="card-title">{element.india_state_union_territory}</h5>
                                <p className="card-text"> {element.category}
                                    {` ${element.population_2011} `}
                                    {element.population_density_per_sq_km___2011}
                                    {element.decadal_population_growth_rate___2001_2011}
                                </p>
                                {/* <a href="#" className="btn btn-primary">Go somewhere</a> */}
                            </div>
                        </div>

                        <br />
                    </div>
                })}

            </div>
        )
    }
}
